import Layout from '../components/layout';

const About = () => {
    return(
        <Layout>
            <div>
                <h1>
                    About BitzPrice
                </h1>
                <p>Application to view Bitcoin prices</p>
            </div>
        </Layout>
    );
}

export default About;
